sys_variable_value.value:
(function execute(inputs, outputs) {
 try {
   var shortDescription = '';
   var shDescGR = new GlideRecord('x_885373_event_tes_custom_subflow_rules');
   shDescGR.addQuery('alert_management_rule.sys_id', inputs.alertRuleId);
   shDescGR.query();
    if(shDescGR.next()){
      if(inputs.priority == 1){
        shortDescription = shDescGR.u_p1_short_description;
   }else if(inputs.priority == 2){
        shortDescription = shDescGR.u_p2_short_description;
   }else if(inputs.priority == 3){
        shortDescription = shDescGR.u_p3_short_description;
     }
   }
  outputs['shortdescription'] = shortDescription;
		
  } catch (ex) {
    var message = ex.getMessage();
    gs.error(message);
  }
})(inputs, outputs);

